import React, { useEffect } from 'react';
//import Exercises from '../components/Exercises';
//import UpdateForm from '../components/ExerciseUpdateForm.js';
import exercisesStore from '../stores/exercisesStore';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import MyNavbar from '../components/MyNavbar';
import ExercisesTable from '../components/ExercisesTable'
import { useParams } from 'react-router-dom';
import workoutsStore from '../stores/workoutsStore';

export default function ExercisesPage() {
    const store = exercisesStore();
    const workoutStore = workoutsStore(store => {
        return {
            fetchWorkouts: store.fetchWorkouts,
            workouts: store.workouts
        }
    });

    const _id = useParams();
    let workoutId;
    workoutStore.fetchWorkouts(_id);

    if (workoutStore.workouts) {
    workoutId = workoutStore.workouts.find(workout =>
        workout._id === _id);
    }

    console.log(workoutId);

    useEffect(() => {
        store.fetchExercises(_id);
    }, [])

    return(
        <Container>
            <Row>
                <Col><MyNavbar /></Col>
            </Row>
            <Row className="body">
                <Col>
                    <h1>Exercises</h1>
                    <ExercisesTable workout_id={_id} />
                </Col>
                <Col>
                {/*<UpdateForm />
                    */}

                </Col>
            </Row>
        </Container>
    );
}
